import React from "react";

import RentalItem from "../rental-item/rental-item.component";

const RentalCategory2 = ({ products }) => (
  <div>
    {products.map((item) => (
      <RentalItem key={item.productId} item={item} />
    ))}
  </div>
);

export default RentalCategory2;
